import React from "react";
import './forecastMain.css';

export default class ForecastMain extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <>
                <div id="mainCard">
                    <div id="info">
                        <h1>{this.props.cityName}</h1>
                        <div id="subInfo">
                            <p>{this.props.currentC}</p>
                            <p>{this.props.text}</p>
                        </div>
                    </div>
                </div>
            </>
        )
    }
}
